import './style.css'

function Footer() {
    return ( 
        <>
            <div className="footer-container"></div>
            <footer className = "footer-inner">
                <p className = "license-footer">@2022 BKMotel</p>
                <a className = "content-footer">Quy chế sử dụng</a>
                <a className = "content-footer">Chính sách bảo mật</a>
                <a className = "content-footer">Liên hệ</a>

            </footer>    
        </>
    )
}


export default Footer;
